- input: "TEXT\x1CC00089243\x1CX0\x1C\x1CF3XA\x1CThis is in response to your letter
    of September 27, 2011 regarding our Amended Year-End Report (11/23/2010-12/31/2010),
    received 7/29/2011.  In this letter, you requested clarification regarding Schedule
    D supporting LIne 10 disclosing a debt totaling $137,015.49 for \"\"Administrative
    & FEA expenses paid from the non-federal acct.\"\".  The committee undertook an
    exhaustive review of expenditures dating back to 2009 as a result of a letter
    from your office in April of 2011.  The committee determined that due to an inadvertent
    error by personnel no longer in the committee's employ, payments for administrative
    and FEA expenses were made from the committee's non-federal account during the
    period covering June 1, 2009 through March 31, 2010.  These inadvertent payments
    totaled $102,194.04 in FEA activities and $34,821.45 in the federal share of administrative
    expenses.  At the completion of this analysis, the committee immediately reimbursed
    the non-federal account $137,015.49 on July 5, 2011.  The committee amended reports
    dating back to June, 2009, disclosing administrative expenses and FEA expenses
    that should have been paid through our federal account as memo entries and accrued
    a liability for funds owed to the non-federal account.  We are confident that
    at no point during this time did the federal share of administrative expenditures
    inadvertently disbursed from the non-federal account exceed the cash on hand available
    in the federal account.  Moving forward, the committee, and the new personnel
    hired to manage the accounting and compliance operations, are making significant
    changes to the way in which disbursements are processed and modified controls
    designed to prevent these types of errors.  The committee will insure that all
    staff with authority to authorize disbursements are properly trained utilizing
    resources from the FEC and from other experienced entities to ensure that all
    expenditures are made in compliance with federal laws and regulations. Please
    feel free to contact me if you have any additional questions.\n"
